//hàm tạo element
function create(tag, att, sub_tag) {
  const e = document.createElement(tag);
  if (att) {
    for (let key in att) {
      // console.log(key);
      e[key] = att[key];
      // console.log(att[key]);
    }
  }
  //// ví dụ sub_tag
  // {
  //   i: {
  //     className: "fa-solid fa-cart-plus fa-lg";
  //   }
  // }
  ////data ví dụ sub_key
  if (sub_tag) {
    for (let key in sub_tag) {
      const a = document.createElement(key);
      // console.log(key);
      if (sub_tag[key]) {
        for (let k in sub_tag[key]) {
          // console.log(key);
          a[k] = sub_tag[key][k];
          // console.log(att[key]);
        }
      }
      e.appendChild(a);
    }
  }
  return e;
}

