// các thẻ cha sẽ append
// container-box1 chứa các nút bấm  ---> box(bọc thẻ i icon,chứa value)
//container2-box1: chứa các hình ảnh trên các nút bám--->item(chứa hình ảnh,chứa value)
//box2:chứa các hình ảnh một bên--->item(chứa hình ảnh, chứa value)
// thuọc tính bên trong hàm create:
//class:ghi trực tiếp trên hàm
// box : ô nút bấm
//item:chứa hình ảnh

//Nếu dữ liệu giống nhau nó sẽ không tạo lại:
// Trong một Object, mỗi key (như ao, quan, khan...) giống như một số điện thoại hoặc một ID duy nhất.Nếu bạn viết hai key trùng tên nhau (ví dụ có 2 chữ ao), JavaScript sẽ ghi đè giá trị sau lên giá trị trước. Nó không tạo ra 2 mục riêng biệt.

//khi tạo không sử dụng class mà phải là ClassName

//tạo xuất hiện khi bấm vào
const but = document.getElementsByClassName("box"); //các nút
const imag = document.getElementsByClassName("item"); //hình ảnh theo sản phẩm của cả 2 khung
const b1 = document.getElementsByClassName("box1"); //đổi màu nền theo sản phẩm
const b2 = document.getElementsByClassName("box2"); //đổi màu nền theo sản phẩm
for (let i = 0; i < but.length; i++) {
  but[i].addEventListener("click", function () {
    for (let x = 0; x < imag.length; x++) {
      if (but[i]["value"] == imag[x]["value"]) {
        //có thể dùng biến là thẻ createElement để so sánh dữ kiện mà không cần getElement lại thêm lần nữa
        imag[x].style.display = ""; //nó phải xuất hiện vì trước đó là none thì không thể xuất hiện được du có thêm bao nhiêu class cũng không xuất hiện  được
        for (let key in data) {
          if (data[key][0].value == imag[x]["value"]) {
            b1[0].style.background = data[key][0].color;
            b2[0].style.background = data[key][0].color; //vì chỉ có 1 phần tử nên vị trí sẽ không thay đổi và luôn ở 0 nếu như lên 1 nó sẽ là undefined
          }
        }
        imag[x].classList.add("fadeblur");
        setTimeout(() => {
          imag[x].classList.remove("fadeblur");
        }, 1070);
      } else {
        imag[x].style.display = "none";
      }
    }
  });
}

